import React from 'react';
import { 
  Timeline, 
  TimelineItem, 
  TimelineSeparator, 
  TimelineDot, 
  TimelineConnector, 
  TimelineContent 
} from '@mui/lab';
import TimelineOppositeContent from '@mui/lab/TimelineOppositeContent';
import Chip from '@mui/material/Chip';
import Stack from '@mui/material/Stack';

const experiences = [
  {
    date: "June 2023 - August 2023",
    label: "Professional Experience",
    title: "Math and English Tutor @ Kumon",
    descriptions: [
      "Tutored students of all ages in Math and English through personalized teaching methods to increase comprehension of skills",
      "Maintained accurate records and performed timely data entry of student grades into the gradebook system"
    ],
    chips: ["Data Entry", "Mentorship", "Communication"]
  },
  {
    date: "February 2024 - Present",
    label: "Experience",
    title: "Graph Visualizations Frontend Developer @ Caesar Research Group PeopleWeave Project",
    descriptions: [
      "Developing an interactive graph visualization to connect researchers, improve networking experiences, and display research collaborations using React.js and D3.js",
      "Collaborating with Graph Visualizations Team to enhance frontend features under Professor Matthew Caesar"
    ],
    chips: ["React.js", "Figma", "Frontend Development", "Graph Visualization", "Data Visualization"]
  },
  {
    date: "February 2024 - Present",
    label: "Experience",
    title: "Design Consultant @ Illinois Design Consulting",
    descriptions: [
      "Designing UI/UX for cybersecurity platform startup Provenance Security using Miro and Figma to create intuitive and cohesive interfaces",
      "Communicating with client to understand user needs and business objectives"
    ],
    chips: ["Figma", "UI/UX", "Miro", "Visual Design", "Prototyping"]
  },
  {
    date: "August 2023 - Present",
    label: "Experience",
    title: "App Developer @ Society of Women Engineers (SWE)",
    descriptions: [
      "Creating an app for John Deere that helps detect and differentiate objects, crops, and animals for farming technology using React.js"
    ],
    chips: ["React.js", "Figma", "JavaScript", "Backend Development", "Frontend Development"]
  },
  {
    date: "February 2023 - Present",
    label: "Experience",
    title: "Marketing Chair @ Reflections Projections Tech Conference",
    descriptions: [
      "Brainstorming and executing innovative marketing strategies, such as unique social media campaigns and on-campus promotions, to increase attendance for an annual tech conference at UIUC",
      "Conducting and planning weekly meetings to communicate timelines and delegate tasks",
      "Successfully attracted over 2,000 registrations for the event last year"
    ],
    chips: ["Digital Marketing", "Data Analysis", "Copywriting", "Social Media Management", "Leadership"]
  },
  {
    date: "August 2022 - May 2024",
    label: "Experience",
    title: "Recruitment Committee Chair @ Society of Women Engineers",
    descriptions: [
      "Planning weekly committee meetings by planning detailed meeting agendas and bonding events",
      "Organizing recruitment events for STEM majors on campus by collaborating with other organizations to enhance outreach"
    ],
    chips: ["Communication", "Leadership", "Organizational Skills", "Event Planning", "Leadership"]
  }
];

const Experience = () => {
  return (
    <div id="experience-section">
      <Timeline>
        {experiences.map((exp, index) => (
          <TimelineItem key={index}>
            <TimelineOppositeContent color="textSecondary">
              {exp.label}
              <br />
              {exp.date}
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineDot />
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent>
              <h4>{exp.title}</h4>
              {exp.descriptions.map((desc, i) => (
                <p key={i}>• {desc}</p>
              ))}
              <Stack direction="row" spacing={1} sx={{ mt: 2 }}>
                {exp.chips.map((chip, i) => (
                  <Chip key={i} label={chip} />
                ))}
              </Stack>
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default Experience;




